import { MdDelete } from "react-icons/md";
import './../index.css'
const colors_block = [
    '#93B5C6',
    '#C9CCD5',
    '#E4D8DC',
    '#FFE3E3'
  ];
const Note = ({id , text, date}) => {
    console.log(id.length.Math.floor(Math.random() * colors_block.length))
    return <div className="Note"    > 
        <span> {id}</span>
        <span> {text} </span>
        <div className="note-footer">
            <small>{date}</small>
            <MdDelete className='delete-icon' size = '16'/>
        </div>
    </div>

}






export default Note;
